import React, { useState } from 'react';
import axios from 'axios';
import './HomePage.css';

const HomePage = () => {
    const [mood, setMood] = useState('');
    const [quote, setQuote] = useState('');
    const [songs, setSongs] = useState([]);
    const [imageUrl, setImageUrl] = useState('');
    const [error, setError] = useState('');
    const [fadeInImage, setFadeInImage] = useState(false);
    const [fadeInSongs, setFadeInSongs] = useState(false);

    // Function to fetch mood info with JWT token
    const fetchMoodInfo = async () => {
        try {
            const token = localStorage.getItem('token'); // Assuming JWT token is stored in localStorage after login
            if (!token) {
                setError('User not authenticated. Please log in.');
                return;
            }

            const response = await axios.post(
                'http://localhost:3002/mood',
                { mood },
                {
                    headers: {
                        Authorization: `Bearer ${token}` // Attach the token in the Authorization header
                    }
                }
            );

            if (response.data) {
                setQuote(response.data.quote);
                setSongs(response.data.songs);
                setImageUrl(response.data.image_url);
                setError('');

                // Trigger re-animation
                triggerFadeInEffects();
            } else {
                setError('Unexpected response format.');
            }
        } catch (err) {
            if (err.response && err.response.status === 401) {
                setError('Unauthorized. Please log in again.');
            } else {
                setError('Error fetching mood information.');
            }
        }
    };

    // Function to handle input change
    const handleMoodChange = (e) => {
        setMood(e.target.value);
    };

    // Trigger the fade-in animation
    const triggerFadeInEffects = () => {
        // Reset animations
        setFadeInImage(false);
        setFadeInSongs(false);

        // Reapply animations after a short delay
        setTimeout(() => {
            setFadeInImage(true);
            setFadeInSongs(true);
        }, 100); // Adjust timing if necessary
    };

    return (
        <div className="home-container">
            <h1>What's Your Mood?</h1>
            <select
                className="home-select"
                value={mood}
                onChange={handleMoodChange}
            >
                <option value="" disabled>Select your mood</option>
                <option value="happy">Happy</option>
                <option value="sad">Sad</option>
                <option value="energized">Energized</option>
                <option value="moody">Moody</option>
                <option value="sleepy">Sleepy</option>
            </select>
            <button className="home-button" onClick={fetchMoodInfo}>
                Get Mood Info
            </button>
            {error && <div className="home-message">{error}</div>}
            {quote && <div className="home-quote">{quote}</div>}
            {imageUrl && <img src={imageUrl} alt="Mood" className={`home-image ${fadeInImage ? 'fade-in' : ''}`} />}
            {songs.length > 0 && (
                <table className={`songs-table ${fadeInSongs ? 'fade-in' : ''}`}>
                    <thead>
                        <tr>
                            <th>#</th>
                            <th>Title</th>
                            <th>Link</th>
                        </tr>
                    </thead>
                    <tbody>
                        {songs.map((song, index) => (
                            <tr key={index}>
                                <td>{index + 1}</td>
                                <td>{song.title}</td>
                                <td>
                                    <a href={song.url} target="_blank" rel="noopener noreferrer">
                                        Listen
                                    </a>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            )}
        </div>
    );
};

export default HomePage;
